import React from 'react';
import './Footer.css'; // Import your CSS file for styling

const Footer = () => {
  return (
    <footer className="footer-container">
      <p>&copy; 2023 Your Turf Booking Site. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
